(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0df855"],{"89ec":function(n,o){n.exports='# FooterToolbar 底部工具栏\n\n固定在底部的工具栏。\n\n\n\n## 何时使用\n\n固定在内容区域的底部，不随滚动条移动，常用于长页面的数据搜集和提交工作。\n\n\n\n引用方式：\n\n```javascript\nimport { FooterToolBar } from \'@/components\'\n\nexport default {\n    components: {\n        FooterToolBar\n    }\n}\n```\n\n\n## 代码演示\n\n```html\n<footer-tool-bar>\n    <a-button type="primary" @click="validate" :loading="loading">提交</a-button>\n</footer-tool-bar>\n```\n或\n```html\n<footer-tool-bar extra="扩展信息提示">\n    <a-button type="primary" @click="validate" :loading="loading">提交</a-button>\n</footer-tool-bar>\n```\n\n\n## API\n\n参数 | 说明 | 类型 | 默认值\n----|------|-----|------\nchildren (slot) | 工具栏内容，向右对齐 | - | -\nextra | 额外信息，向左对齐 | String, Object | -\n\n'}}]);